description:
CAST
India Summer, Khloe Kush, Casi James, Jaslene Jade, Molly Bennett, Veronica Avluv, Jessy Jones, Rick Garcia, Logan Pierce, Eric Swiss, Evan Stone &amp; Alec Knight.


DESCRIPTION
It's a wild family affair when the Stone family starts dating the Smith's. Mr. Stone (Evan Stone) has a daughter (Jaslene Jade) who loves older men and entices his brother in-law(Alec Knight) into a steamy middle of the night encounter. Jaslene even makes her uncle creampie her. Wow, this could spell trouble in the future. Meanwhile Mr. Stone and his wife (India Summer) are getting it on with the Smith's freshman daughter (Mandy Armani) and her son Logan ends up in bed with Mrs. Smith (Veronica Avluv) and her daughter Khloe ( Khloe Kush). Not to be outdone Mr. Smith (Eric Swiss) gets in on the action when his son Jessie takes out Molly Stone (Molly Bennett) on a date. That's a bicycle built for two.

